async function checkAndRebalancePosition(position, thresholdBps, orcaService) {
  elizaLogger2.log(`Checking position ${position.positionMint}. InRange: ${position.inRange}, DistanceBps: ${position.distanceCenterPositionFromPoolPriceBps}, ThresholdBps: ${thresholdBps}`);
  if (!position.inRange || position.distanceCenterPositionFromPoolPriceBps > thresholdBps) {
    elizaLogger2.info(`Position ${position.positionMint} needs rebalancing.`);
    try {
      const whirlpool = await fetchWhirlpool2(orcaService.rpc, position.whirlpoolAddress);
      if (!whirlpool) {
        elizaLogger2.error(`Could not fetch whirlpool data for ${position.whirlpoolAddress}`);
        return;
      }
      const [mintA, mintB] = await fetchAllMint(orcaService.rpc, [
        whirlpool.data.tokenMintA,
        whirlpool.data.tokenMintB
      ]);
      if (!mintA || !mintB) {
        elizaLogger2.error(`Could not fetch mint data for tokens in whirlpool ${position.whirlpoolAddress}`);
        return;
      }
      const fullPositionData = await fetchPosition(orcaService.rpc, position.positionMint);
      if (!fullPositionData) {
        elizaLogger2.error(`Could not fetch full position data for ${position.positionMint}`);
        return;
      }
      const client = buildWhirlpoolClient(orcaService.rpc);
      const positionObj = await client.getPosition(position.positionMint);
      const positionData = positionObj.getData();
      const amountToReinvestBN = new import_bn.default(positionData.liquidity.toString());
      let reinvestTokenAmount = amountToReinvestBN.toNumber();
      if (reinvestTokenAmount === 0) {
        elizaLogger2.warn(`Position ${position.positionMint} had zero reinvestable liquidity based on old amounts. Using minimal amount (1 raw unit) for new position.`);
        reinvestTokenAmount = 1;
      }
      const currentPrice = sqrtPriceToPrice2(
        whirlpool.data.sqrtPrice,
        // This is BigInt
        mintA.data.decimals,
        mintB.data.decimals
      );
      const newLowerPriceDecimal = new decimal_default(currentPrice.toString()).mul(0.95);
      const newUpperPriceDecimal = new decimal_default(currentPrice.toString()).mul(1.05);
      const tickSpacing = whirlpool.data.tickSpacing;
      const newLowerTick = PriceMath.priceToTickIndex(newLowerPriceDecimal, mintA.data.decimals, mintB.data.decimals);
      const newUpperTick = PriceMath.priceToTickIndex(newUpperPriceDecimal, mintA.data.decimals, mintB.data.decimals);
      elizaLogger2.log(`Attempting to close position: ${position.positionMint}`);
      const closed = await orcaService.close_position(position.positionMint);
      if (!closed) {
        elizaLogger2.warn(`Failed to close position ${position.positionMint}. Rebalancing aborted.`);
        return;
      }
      elizaLogger2.info(`Successfully closed position ${position.positionMint}.`);
      await new Promise((resolve) => setTimeout(resolve, 2e3));
      const newPositionParams = {
        whirlpoolAddress: position.whirlpoolAddress,
        lowerTick: newLowerTick,
        upperTick: newUpperTick,
        tokenAmount: reinvestTokenAmount
      };
      elizaLogger2.log(`Opening new position with params:`, {
        pool: position.whirlpoolAddress.slice(0, 8) + "...",
        lowerTick: newPositionParams.lowerTick,
        upperTick: newPositionParams.upperTick,
        tokenAmount: newPositionParams.tokenAmount,
        approxLowerPrice: newLowerPriceDecimal.toFixed(mintB.data.decimals),
        // For logging
        approxUpperPrice: newUpperPriceDecimal.toFixed(mintB.data.decimals)
        // For logging
      });
      const newMint = await orcaService.open_position(newPositionParams);
      if (newMint) {
        elizaLogger2.info(`Successfully opened new position: ${newMint}. Old position: ${position.positionMint}`);
      } else {
        elizaLogger2.warn(`Failed to open new position after closing ${position.positionMint}. 'open_position' returned null.`);
      }
    } catch (error) {
      elizaLogger2.error(`Rebalancing error for position ${position.positionMint}:`, error);
      if (error instanceof Error && error.stack) {
        elizaLogger2.error("Stack trace for rebalancing error:", error.stack);
      }
    }
  }
}

